import React from 'react'

const AppointmentCard = ({doctorName, patientName, phoneNumber, email, reasonForVisit,deleted}) => {
    return (
        <div>
            <p>{doctorName}</p>
            <p>{patientName}</p>
            <p>{phoneNumber}</p>
            <p>{email}</p>
        </div>
    )
}

export default AppointmentCard
